<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Treinamento - Corretores Consultores | Cr√©dito Real</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, #1a1a1a 0%, #2d2d2d 100%);
            color: #fff;
            min-height: 100vh;
            padding: 20px;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
        }

        header {
            text-align: center;
            padding: 40px 20px;
            background: linear-gradient(135deg, #ff6b00 0%, #ff8533 100%);
            border-radius: 20px;
            margin-bottom: 30px;
            box-shadow: 0 10px 30px rgba(255, 107, 0, 0.3);
        }

        header h1 {
            font-size: 2.5rem;
            margin-bottom: 10px;
            text-transform: uppercase;
            letter-spacing: 2px;
        }

        header p {
            font-size: 1.1rem;
            opacity: 0.95;
        }

        .progress-section {
            background: #2d2d2d;
            padding: 25px;
            border-radius: 15px;
            margin-bottom: 30px;
            box-shadow: 0 5px 20px rgba(0,0,0,0.3);
        }

        .progress-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 15px;
        }

        .progress-text {
            font-size: 1.1rem;
            font-weight: 600;
        }

        .progress-percentage {
            font-size: 1.5rem;
            color: #ff6b00;
            font-weight: bold;
        }

        .progress-bar-container {
            background: #1a1a1a;
            height: 30px;
            border-radius: 15px;
            overflow: hidden;
            position: relative;
        }

        .progress-bar {
            height: 100%;
            background: linear-gradient(90deg, #ff6b00 0%, #ff8533 100%);
            transition: width 0.5s ease;
            display: flex;
            align-items: center;
            justify-content: flex-end;
            padding-right: 10px;
            font-weight: bold;
        }

        .tabs-container {
            display: flex;
            gap: 10px;
            margin-bottom: 30px;
            overflow-x: auto;
            padding: 10px 0;
        }

        .tab {
            background: #2d2d2d;
            color: #fff;
            border: 2px solid #3d3d3d;
            padding: 15px 20px;
            border-radius: 10px;
            cursor: pointer;
            transition: all 0.3s ease;
            font-weight: 600;
            position: relative;
            min-width: 200px;
            text-align: left;
        }
        
        .tab-number {
            display: block;
            font-size: 0.75rem;
            color: #ff6b00;
            margin-bottom: 5px;
            font-weight: 700;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .tab-title {
            display: block;
            font-size: 0.9rem;
            line-height: 1.3;
        }

        .tab:hover {
            background: #3d3d3d;
            transform: translateY(-2px);
        }

        .tab.active {
            background: #ff6b00;
            border-color: #ff6b00;
            box-shadow: 0 5px 15px rgba(255, 107, 0, 0.4);
        }

        .tab.completed::after {
            content: '‚úì';
            position: absolute;
            top: -8px;
            right: -8px;
            background: #00c853;
            color: white;
            width: 24px;
            height: 24px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 14px;
            font-weight: bold;
        }

        .module-content {
            display: none;
            background: #2d2d2d;
            padding: 40px;
            border-radius: 15px;
            box-shadow: 0 5px 20px rgba(0,0,0,0.3);
        }

        .module-content.active {
            display: block;
            animation: slideIn 0.5s ease;
        }

        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .module-header {
            margin-bottom: 30px;
        }

        .module-header h2 {
            font-size: 2rem;
            color: #ff6b00;
            margin-bottom: 15px;
        }

        .module-header p {
            font-size: 1.1rem;
            line-height: 1.6;
            color: #ccc;
        }

        .video-card {
            background: linear-gradient(135deg, #ff6b00 0%, #ff8533 100%);
            border-radius: 20px;
            padding: 0;
            margin: 30px 0;
            cursor: pointer;
            transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            overflow: hidden;
            border: none;
            box-shadow: 0 10px 40px rgba(255, 107, 0, 0.4);
        }

        .video-card::before {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 100%;
            height: 100%;
            background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
            animation: shimmer 3s infinite;
        }

        @keyframes shimmer {
            to {
                left: 100%;
            }
        }

        .video-card:hover {
            transform: translateY(-8px) scale(1.03);
            box-shadow: 0 20px 60px rgba(255, 107, 0, 0.6);
        }
        
        .video-card:hover .play-button {
            transform: scale(1.15);
        }
        
        .video-card:hover .video-thumbnail {
            transform: scale(1.05);
        }

        .video-badge {
            display: inline-block;
            background: rgba(0, 0, 0, 0.8);
            color: white;
            padding: 10px 20px;
            border-radius: 25px;
            font-size: 0.75rem;
            font-weight: bold;
            margin-bottom: 0;
            text-transform: uppercase;
            letter-spacing: 1.5px;
            position: absolute;
            top: 20px;
            left: 20px;
            z-index: 2;
            backdrop-filter: blur(10px);
        }
        
        .video-inner-wrapper {
            background: #1a1a1a;
            margin: 4px;
            border-radius: 16px;
            overflow: hidden;
        }
        
        .video-thumbnail {
            position: relative;
            height: 280px;
            background: linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%);
            display: flex;
            align-items: center;
            justify-content: center;
            overflow: hidden;
            transition: transform 0.4s ease;
        }
        
        .video-thumbnail::before {
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            background: radial-gradient(circle at center, rgba(255, 107, 0, 0.2) 0%, transparent 70%);
        }

        .video-content {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 0;
            position: relative;
            z-index: 1;
        }

        .play-button {
            width: 120px;
            height: 120px;
            background: #ff6b00;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            position: relative;
            flex-shrink: 0;
            box-shadow: 0 10px 40px rgba(255, 107, 0, 0.6);
            transition: transform 0.3s ease;
        }

        .play-button::before,
        .play-button::after {
            content: '';
            position: absolute;
            border-radius: 50%;
            border: 3px solid #ff6b00;
            animation: pulse 2s infinite;
        }

        .play-button::before {
            width: 150px;
            height: 150px;
        }

        .play-button::after {
            width: 180px;
            height: 180px;
            animation-delay: 1s;
        }

        @keyframes pulse {
            0% {
                transform: scale(1);
                opacity: 1;
            }
            100% {
                transform: scale(1.3);
                opacity: 0;
            }
        }

        .play-icon {
            width: 0;
            height: 0;
            border-left: 35px solid white;
            border-top: 22px solid transparent;
            border-bottom: 22px solid transparent;
            margin-left: 8px;
        }

        .video-info {
            text-align: center;
            margin-top: 25px;
        }
        
        .video-info h3 {
            font-size: 1.8rem;
            margin-bottom: 15px;
            color: #fff;
            text-shadow: 0 2px 10px rgba(0, 0, 0, 0.3);
        }

        .video-hint {
            color: #fff;
            font-weight: 700;
            font-size: 1.1rem;
            animation: bounce 2s infinite;
            text-shadow: 0 2px 8px rgba(0, 0, 0, 0.4);
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 8px;
        }

        @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-5px); }
        }

        .video-footer {
            margin-top: 0;
            padding: 25px 30px;
            border-top: none;
            background: #2d2d2d;
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 15px;
            font-size: 1rem;
        }
        
        .video-footer::before {
            content: '‚ñ∂';
            color: #ff6b00;
            font-size: 1.2rem;
        }

        .checklist {
            background: #1a1a1a;
            padding: 25px;
            border-radius: 10px;
            margin: 30px 0;
        }

        .checklist h3 {
            color: #ff6b00;
            margin-bottom: 20px;
            font-size: 1.3rem;
        }

        .checklist-item {
            display: flex;
            align-items: center;
            gap: 15px;
            padding: 15px;
            margin: 10px 0;
            background: #2d2d2d;
            border-radius: 8px;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .checklist-item:hover {
            background: #3d3d3d;
            transform: translateX(5px);
        }

        .checkbox {
            width: 24px;
            height: 24px;
            border: 2px solid #ff6b00;
            border-radius: 5px;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s ease;
        }

        .checklist-item.checked .checkbox {
            background: #ff6b00;
        }

        .checklist-item.checked .checkbox::after {
            content: '‚úì';
            color: white;
            font-weight: bold;
        }

        .completion-section {
            background: linear-gradient(135deg, #00c853 0%, #00e676 100%);
            padding: 40px;
            border-radius: 15px;
            margin: 30px 0;
            text-align: center;
            animation: slideIn 0.5s ease;
        }

        .completion-section h2 {
            font-size: 2.5rem;
            margin-bottom: 10px;
        }

        .completion-icon {
            font-size: 4rem;
            display: inline-block;
            animation: rotate 2s linear infinite;
        }

        @keyframes rotate {
            from { transform: rotate(0deg); }
            to { transform: rotate(360deg); }
        }

        .next-step-banner {
            background: linear-gradient(135deg, #ff6b00 0%, #ff8533 100%);
            padding: 30px;
            border-radius: 15px;
            margin: 20px 0;
            text-align: center;
        }

        .next-step-banner h3 {
            font-size: 1.8rem;
            margin-bottom: 10px;
        }

        .evaluation-card {
            background: #1a1a1a;
            padding: 40px;
            border-radius: 15px;
            margin: 30px 0;
            border: 3px solid #ff6b00;
        }

        .evaluation-card h3 {
            color: #ff6b00;
            font-size: 1.8rem;
            margin-bottom: 20px;
            text-transform: uppercase;
        }

        .requirements {
            background: #2d2d2d;
            padding: 25px;
            border-radius: 10px;
            margin: 20px 0;
        }

        .requirements h4 {
            color: #ff6b00;
            margin-bottom: 15px;
        }

        .requirements ul {
            list-style: none;
            padding: 0;
        }

        .requirements li {
            padding: 10px 0;
            padding-left: 30px;
            position: relative;
        }

        .requirements li::before {
            content: '‚úì';
            position: absolute;
            left: 0;
            color: #00c853;
            font-weight: bold;
        }

        .benefits-list {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 15px;
            margin: 20px 0;
        }

        .benefit-item {
            background: #2d2d2d;
            padding: 20px;
            border-radius: 10px;
            border-left: 4px solid #ff6b00;
        }

        .navigation-buttons {
            display: flex;
            justify-content: space-between;
            margin-top: 40px;
            gap: 15px;
        }

        .btn {
            padding: 15px 30px;
            border: none;
            border-radius: 10px;
            font-size: 1rem;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            text-decoration: none;
            display: inline-flex;
            align-items: center;
            gap: 10px;
        }

        .btn-primary {
            background: #ff6b00;
            color: white;
        }

        .btn-primary:hover {
            background: #ff8533;
            transform: translateY(-2px);
            box-shadow: 0 5px 15px rgba(255, 107, 0, 0.4);
        }

        .btn-secondary {
            background: #3d3d3d;
            color: white;
        }

        .btn-secondary:hover {
            background: #4d4d4d;
        }

        .btn-success {
            background: #00c853;
            color: white;
            font-size: 1.2rem;
            padding: 20px 40px;
            width: 100%;
            justify-content: center;
        }

        .btn-success:hover {
            background: #00e676;
            transform: scale(1.05);
        }

        .btn-complete {
            background: #00c853;
            color: white;
        }

        .btn-complete:hover {
            background: #00e676;
        }

        .tip-box {
            background: #2d2d2d;
            border-left: 4px solid #ff6b00;
            padding: 20px;
            border-radius: 8px;
            margin: 20px 0;
        }

        .tip-box strong {
            color: #ff6b00;
        }
        
        .audio-player-section {
            background: linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%);
            padding: 30px;
            border-radius: 15px;
            margin: 30px 0;
            border: 2px solid #ff6b00;
        }
        
        .audio-player-header {
            display: flex;
            align-items: center;
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .audio-icon {
            font-size: 2.5rem;
        }
        
        .audio-player-header h4 {
            color: #ff6b00;
            font-size: 1.3rem;
            margin: 0;
        }
        
        .audio-player-header p {
            color: #ccc;
            margin: 5px 0 0 0;
            font-size: 0.95rem;
        }
        
        .audio-open-btn {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 12px;
            background: #ff6b00;
            color: white;
            padding: 18px 35px;
            border-radius: 10px;
            text-decoration: none;
            font-weight: 600;
            font-size: 1.1rem;
            transition: all 0.3s ease;
            border: none;
            cursor: pointer;
            margin-top: 20px;
        }
        
        .audio-open-btn:hover {
            background: #ff8533;
            transform: translateY(-2px);
            box-shadow: 0 5px 15px rgba(255, 107, 0, 0.4);
        }
        
        /* Link Access Section */
        .link-access-section {
            background: linear-gradient(135deg, #1a3a52 0%, #0d1f2d 100%);
            padding: 30px;
            border-radius: 15px;
            margin: 30px 0;
            border: 2px solid #4a9eff;
        }
        
        .link-access-header {
            display: flex;
            align-items: center;
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .link-icon {
            font-size: 2.5rem;
        }
        
        .link-access-header h4 {
            color: #4a9eff;
            font-size: 1.3rem;
            margin: 0;
        }
        
        .link-access-header p {
            color: #ccc;
            margin: 5px 0 0 0;
            font-size: 0.95rem;
        }
        
        .link-access-btn {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 12px;
            background: #4a9eff;
            color: white;
            padding: 18px 35px;
            border-radius: 10px;
            text-decoration: none;
            font-weight: 600;
            font-size: 1.1rem;
            transition: all 0.3s ease;
            border: none;
            cursor: pointer;
            margin-top: 20px;
        }
        
        .link-access-btn:hover {
            background: #6bb0ff;
            transform: translateY(-2px);
            box-shadow: 0 5px 15px rgba(74, 158, 255, 0.4);
        }
        
        .audio-controls {
            background: #1a1a1a;
            padding: 20px;
            border-radius: 10px;
            display: flex;
            align-items: center;
            gap: 15px;
        }
        
        .audio-play-btn {
            width: 60px;
            height: 60px;
            background: #ff6b00;
            border: none;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            transition: all 0.3s ease;
            flex-shrink: 0;
        }
        
        .audio-play-btn:hover {
            background: #ff8533;
            transform: scale(1.1);
        }
        
        .audio-play-btn .play-icon-small {
            width: 0;
            height: 0;
            border-left: 20px solid white;
            border-top: 12px solid transparent;
            border-bottom: 12px solid transparent;
            margin-left: 3px;
        }
        
        .audio-play-btn .pause-icon {
            display: none;
            width: 20px;
            height: 20px;
        }
        
        .audio-play-btn .pause-icon::before,
        .audio-play-btn .pause-icon::after {
            content: '';
            position: absolute;
            width: 6px;
            height: 20px;
            background: white;
        }
        
        .audio-play-btn .pause-icon::before {
            left: 18px;
        }
        
        .audio-play-btn .pause-icon::after {
            right: 18px;
        }
        
        .audio-timeline {
            flex: 1;
            display: flex;
            flex-direction: column;
            gap: 10px;
        }
        
        .audio-progress-bar {
            width: 100%;
            height: 8px;
            background: #3d3d3d;
            border-radius: 4px;
            cursor: pointer;
            position: relative;
            overflow: hidden;
        }
        
        .audio-progress-fill {
            height: 100%;
            background: #ff6b00;
            width: 0%;
            transition: width 0.1s linear;
        }
        
        .audio-time {
            display: flex;
            justify-content: space-between;
            font-size: 0.85rem;
            color: #ccc;
        }
        
        audio {
            display: none;
        }
        
        .submodules-section {
            margin: 40px 0;
        }
        
        .submodules-header {
            background: linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%);
            padding: 25px;
            border-radius: 15px;
            margin-bottom: 25px;
            border-left: 5px solid #ff6b00;
        }
        
        .submodules-header h3 {
            color: #ff6b00;
            font-size: 1.5rem;
            margin-bottom: 10px;
            display: flex;
            align-items: center;
            gap: 10px;
        }
        
        .submodules-header p {
            color: #ccc;
            font-size: 1rem;
        }
        
        .submodule-card {
            background: #1a1a1a;
            border-radius: 15px;
            margin: 20px 0;
            overflow: hidden;
            border: 2px solid #3d3d3d;
            transition: all 0.3s ease;
        }
        
        .submodule-card:hover {
            border-color: #ff6b00;
            box-shadow: 0 5px 20px rgba(255, 107, 0, 0.2);
        }
        
        .submodule-header {
            background: #2d2d2d;
            padding: 20px 25px;
            cursor: pointer;
            display: flex;
            justify-content: space-between;
            align-items: center;
            transition: all 0.3s ease;
        }
        
        .submodule-header:hover {
            background: #3d3d3d;
        }
        
        .submodule-title {
            display: flex;
            align-items: center;
            gap: 15px;
            flex: 1;
        }
        
        .submodule-number {
            background: #ff6b00;
            color: white;
            width: 40px;
            height: 40px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            font-weight: bold;
            font-size: 1.1rem;
        }
        
        .submodule-name {
            font-size: 1.1rem;
            font-weight: 600;
            color: #fff;
        }
        
        .submodule-toggle {
            font-size: 1.5rem;
            color: #ff6b00;
            transition: transform 0.3s ease;
        }
        
        .submodule-card.active .submodule-toggle {
            transform: rotate(180deg);
        }
        
        .submodule-content {
            max-height: 0;
            overflow: hidden;
            transition: max-height 0.4s ease;
        }
        
        .submodule-card.active .submodule-content {
            max-height: 2000px;
        }
        
        .submodule-inner {
            padding: 30px;
            background: #1a1a1a;
        }
        
        .pdf-download-section {
            background: linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%);
            padding: 25px;
            border-radius: 12px;
            margin-top: 30px;
            border: 2px dashed #ff6b00;
        }
        
        .pdf-download-header {
            display: flex;
            align-items: center;
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .pdf-icon {
            font-size: 2.5rem;
        }
        
        .pdf-download-header h4 {
            color: #ff6b00;
            font-size: 1.3rem;
            margin: 0;
        }
        
        .pdf-download-header p {
            color: #ccc;
            margin: 5px 0 0 0;
            font-size: 0.95rem;
        }
        
        .pdf-download-btn {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 12px;
            background: #ff6b00;
            color: white;
            padding: 15px 30px;
            border-radius: 10px;
            text-decoration: none;
            font-weight: 600;
            font-size: 1rem;
            transition: all 0.3s ease;
            border: none;
            cursor: pointer;
            width: 100%;
        }
        
        .pdf-download-btn:hover {
            background: #ff8533;
            transform: translateY(-2px);
            box-shadow: 0 5px 15px rgba(255, 107, 0, 0.4);
        }
        
        .pdf-download-btn::before {
            content: 'üìÑ';
            font-size: 1.5rem;
        }

        @media (max-width: 768px) {
            header h1 {
                font-size: 1.8rem;
            }

            .tabs-container {
                flex-wrap: nowrap;
                overflow-x: auto;
            }

            .tab {
                flex: 0 0 auto;
                min-width: 180px;
            }

            .module-content {
                padding: 20px;
            }

            .video-thumbnail {
                height: 200px;

        // Sistema de salvamento de progresso individual por usu√°rio
        // Cada corretor mant√©m seu pr√≥prio progresso salvo no navegador

        function updateProgress() {
            const progress = (completedModules.size / modules.length) * 100;
            const progressBar = document.getElementById('progressBar');
            const progressPercentage = document.getElementById('progressPercentage');
            
            progressBar.style.width = progress + '%';
            progressPercentage.textContent = Math.round(progress) + '%';
        }
        
        // Salvar progresso no localStorage
        function saveProgress() {
            const progressData = {
                currentModule: currentModule,
                completedModules: Array.from(completedModules),
                checkedItems: getCheckedItems(),
                expandedSubmodules: getExpandedSubmodules()
            };
            localStorage.setItem('treinamentoCorretor_progresso', JSON.stringify(progressData));
        }
        
        // Carregar progresso do localStorage
        function loadProgress() {
            const saved = localStorage.getItem('treinamentoCorretor_progresso');
            if (saved) {
                try {
                    const progressData = JSON.parse(saved);
                    
                    // Restaurar m√≥dulo atual
                    currentModule = progressData.currentModule || 0;
                    
                    // Restaurar m√≥dulos completos
                    if (progressData.completedModules) {
                        progressData.completedModules.forEach(mod => completedModules.add(mod));
                    }
                    
                    return progressData;
                } catch (e) {
                    console.error('Erro ao carregar progresso:', e);
                    return null;
                }
            }
            return null;
        }
        
        // Obter itens do checklist marcados
        function getCheckedItems() {
            const checked = {};
            document.querySelectorAll('.checklist-item.checked').forEach(item => {
                const moduleMatch = item.closest('.module-content');
                if (moduleMatch) {
                    const moduleId = moduleMatch.id;
                    const itemIndex = Array.from(item.parentElement.children).indexOf(item);
                    if (!checked[moduleId]) checked[moduleId] = [];
                    checked[moduleId].push(itemIndex);
                }
            });
            return checked;
        }
        
        // Obter subm√≥dulos expandidos
        function getExpandedSubmodules() {
            const expanded = [];
            document.querySelectorAll('.submodule-card.active').forEach(card => {
                expanded.push(card.id);
            });
            return expanded;
        }
        
        // Restaurar itens do checklist
        function restoreCheckedItems(checkedItems) {
            if (!checkedItems) return;
            
            Object.keys(checkedItems).forEach(moduleId => {
                checkedItems[moduleId].forEach(itemIndex => {
                    const item = document.querySelector(`#${moduleId} .checklist-item:nth-child(${itemIndex + 1})`);
                    if (item) item.classList.add('checked');
                });
            });
        }
        
        // Restaurar subm√≥dulos expandidos
        function restoreExpandedSubmodules(expandedSubmodules) {
            if (!expandedSubmodules) return;
            
            expandedSubmodules.forEach(subId => {

                if (sub) sub.classList.add('active');
            });
        }

            const pdfSection = module.hasPdf ? `
                <div class="pdf-download-section">
                    <div class="pdf-download-header">
                        <div class="pdf-icon">üìÑ</div>
                        <div>
                            <h4>${module.pdfTitle || (module.hasSubmodules ? 'Baixe o material explicativo das garantias' : 'Baixe o material do v√≠deo')}</h4>
                            <p>Clique no bot√£o abaixo e baixe o documento completo para ler com aten√ß√£o</p>
                        </div>
                    </div>
                    <button class="pdf-download-btn" onclick="downloadPDF('${module.pdfUrl || ''}', '${module.pdfName}')">
                        üì• Baixar Procedimento Completo
                    </button>
                </div>
            ` : '';

            const linkSection = module.hasLink ? `
                <div class="link-access-section">
                    <div class="link-access-header">
                        <div class="link-icon">üîó</div>
                        <div>
                            <h4>${module.linkTitle || 'Acesse a plataforma'}</h4>
                            <p>${module.linkDescription || 'Clique no bot√£o abaixo para acessar'}</p>
                        </div>
                    </div>
                    <a href="${module.linkUrl}" target="_blank" class="link-access-btn">
                        üöÄ Acessar Plataforma
                    </a>
                </div>
            ` : '';

            const submodulesSection = module.hasSubmodules ? `
                <div class="submodules-section">
                    <div class="submodules-header">
                        <h3>${module.submodulesTitle || 'üìö Assista os v√≠deos sobre o funcionamento de cada garantia'}</h3>
                        <p>${module.submodulesDescription || 'Clique em cada item abaixo para acessar o v√≠deo explicativo detalhado.'}</p>
                    </div>
                    ${module.submodules.map((sub, subIndex) => `
                        <div class="submodule-card" id="submodule-${index}-${subIndex}">
                            <div class="submodule-header" onclick="toggleSubmodule(${index}, ${subIndex})">
                                <div class="submodule-title">
                                    <div class="submodule-number">${subIndex + 1}</div>
                                    <div class="submodule-name">${sub.title}</div>
                                </div>
                                <div class="submodule-toggle">‚ñº</div>
                            </div>
                            <div class="submodule-content">
                                <div class="submodule-inner">
                                    <div class="video-card" onclick="window.open('${sub.video}', '_blank')">
                                        <span class="video-badge">üé¨ V√çDEO ESSENCIAL</span>
                                        <div class="video-inner-wrapper">
                                            <div class="video-thumbnail">
                                                <div class="video-content">
                                                    <div class="play-button">
                                                        <div class="play-icon"></div>
                                                    </div>
                                                    <div class="video-info">
                                                        <h3>${sub.title}</h3>
                                                        <p class="video-hint">
                                                            <span>üëÜ</span>
                                                            <span>Clique aqui para assistir agora</span>
                                                        </p>
                                                    </div>
                                                </div>
                                            </div>
                                            <div class="video-footer">
                                                <strong>CLIQUE PARA ASSISTIR O V√çDEO COMPLETO</strong>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    `).join('')}
                </div>
            ` : '';

            return `
                <div class="module-content" id="module${index}">
                    <div class="module-header">
                        <h2>M√≥dulo ${index + 1}: ${module.title}</h2>
                        <p>${module.description}</p>
                    </div>

                    ${audioSection}
                    ${videoSection}
                    ${linkSection}
                    ${pdfSection}
                    ${submodulesSection}

                    <div class="checklist">
                        <h3>üìã Checklist de Aprendizado</h3>
                        ${module.checklist.map((item, i) => `
                            <div class="checklist-item" onclick="toggleChecklistItem(${index}, ${i})">
                                <div class="checkbox"></div>
                                <span>${item}</span>
                            </div>
                        `).join('')}
                    </div>

                    <div class="navigation-buttons">
                        <button class="btn btn-secondary" onclick="previousModule()" ${index === 0 ? 'style="visibility: hidden;"' : ''}>
                            ‚Üê Anterior
                        </button>
                        <button class="btn btn-complete" onclick="markAsComplete(${index})">
                            ‚úì Marcar como Conclu√≠do
                        </button>
                        <button class="btn btn-primary" onclick="nextModule()">
                            ${index === modules.length - 1 ? 'Finalizar Curso ‚Üí' : 'Pr√≥ximo ‚Üí'}
                        </button>
                    </div>
                </div>
            `;
        }

        function createFinalModule() {
            return `
                <div class="module-content" id="moduleFinal">
                    <div class="completion-section">
                        <div class="completion-icon">‚úÖ</div>
                        <h2>üéâ CURSO CONCLU√çDO COM SUCESSO!</h2>
                        <p style="font-size: 1.2rem; margin-top: 10px;">Parab√©ns por completar todos os m√≥dulos do treinamento!</p>
                    </div>

                    <div class="next-step-banner">
                        <h3>‚ö†Ô∏è Agora falta apenas um passo para conquistar seu certificado!</h3>
                    </div>

                    <div class="evaluation-card">
                        <h3>üéØ PR√ìXIMO PASSO OBRIGAT√ìRIO: Avalia√ß√£o Final</h3>
                        
                        <div class="requirements">
                            <h4>Requisitos para Certifica√ß√£o:</h4>
                            <ul>
                                <li><strong>Pontua√ß√£o M√≠nima:</strong> 70% de acertos</li>
                                <li><strong>Local:</strong> Universidade Corporativa</li>
                                <li><strong>Tentativas:</strong> Ilimitadas at√© atingir a nota m√≠nima</li>
                                <li><strong>Import√¢ncia:</strong> Sem aprova√ß√£o na avalia√ß√£o, voc√™ N√ÉO receber√° o certificado</li>
                            </ul>
                        </div>

                        <div class="benefits-list">
                            <div class="benefit-item">
                                <strong>üìú Certificado Digital</strong>
                                <p>Reconhecimento oficial da conclus√£o</p>
                            </div>
                            <div class="benefit-item">
                                <strong>üèÜ Valida√ß√£o de Compet√™ncias</strong>
                                <p>Comprove seu conhecimento adquirido</p>
                            </div>
                            <div class="benefit-item">
                                <strong>üìà Desenvolvimento Profissional</strong>
                                <p>Evolu√ß√£o na carreira de corretor consultor</p>
                            </div>
                            <div class="benefit-item">
                                <strong>‚úÖ Registro no Sistema</strong>
                                <p>Hist√≥rico de capacita√ß√£o atualizado</p>
                            </div>
                        </div>

                        <a href="https://universidade.centraldofranqueado.com.br/[ID_DO_CURSO]" target="_blank" class="btn btn-success">
                            üöÄ IR PARA A AVALIA√á√ÉO
                        </a>

                        <div class="tip-box">
                            <strong>üí° Dica Final:</strong> Antes de realizar a avalia√ß√£o, revise os principais conceitos de cada m√≥dulo. Voc√™ pode revisar os v√≠deos e materiais sempre que necess√°rio!
                        </div>
                    </div>

                    <div class="navigation-buttons">
                        <button class="btn btn-secondary" onclick="previousModule()">
                            ‚Üê Voltar
                        </button>
                    </div>
                </div>
            `;
        }

        function renderModules() {
            const container = document.getElementById('modulesContainer');
            let html = '';
            
            modules.forEach((module, index) => {
                html += createModuleContent(module, index);
            });
            
            html += createFinalModule();
            container.innerHTML = html;
        }

        function switchModule(index) {
            currentModule = index;
            
            // Atualizar tabs
            const tabs = document.querySelectorAll('.tab');
            tabs.forEach((tab, i) => {
                tab.classList.remove('active');
                if (i === index) {
                    tab.classList.add('active');
                }
            });
            
            // Atualizar conte√∫do
            const contents = document.querySelectorAll('.module-content');
            contents.forEach((content, i) => {
                content.classList.remove('active');
                if ((i === index && index < modules.length) || (index === modules.length && content.id === 'moduleFinal')) {
                    content.classList.add('active');
                }
            });
            
            // Salvar progresso
            saveProgress();
        }

        function nextModule() {
            if (currentModule < modules.length) {
                switchModule(currentModule + 1);
                window.scrollTo({ top: 0, behavior: 'smooth' });
            }
        }

        function previousModule() {
            if (currentModule > 0) {
                switchModule(currentModule - 1);
                window.scrollTo({ top: 0, behavior: 'smooth' });
            }
        }

        function toggleChecklistItem(moduleIndex, itemIndex) {
            // Toggle visual e salvar progresso
            const item = document.querySelector(`#module${moduleIndex} .checklist-item:nth-child(${itemIndex + 1})`);
            item.classList.toggle('checked');
            
            // Salvar progresso
            saveProgress();
        }
        
        function toggleSubmodule(moduleIndex, subIndex) {
            const clickedSubmodule = document.getElementById(`submodule-${moduleIndex}-${subIndex}`);
            const isCurrentlyActive = clickedSubmodule.classList.contains('active');
            
            // Fechar todos os subm√≥dulos do mesmo m√≥dulo
            const allSubmodulesInModule = document.querySelectorAll(`[id^="submodule-${moduleIndex}-"]`);
            allSubmodulesInModule.forEach(sub => {
                sub.classList.remove('active');
            });
            
            // Se o subm√≥dulo clicado n√£o estava aberto, abre ele
            // Se estava aberto, deixa fechado (toggle)
            if (!isCurrentlyActive) {
                clickedSubmodule.classList.add('active');
            }
            
            // Salvar progresso
            saveProgress();
        }
        
        // Fun√ß√£o para download do PDF
        function downloadPDF(pdfUrl, pdfName) {
            if (!pdfUrl || pdfUrl === '') {
                alert('PDF: ' + pdfName + '\n\nEm breve voc√™ poder√° fazer o download deste material!');
                return;
            }
            
            // Criar link para download
            const link = document.createElement('a');
            link.href = pdfUrl;
            link.download = pdfName;
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
        }

        function markAsComplete(moduleIndex) {
            // Marca como completo e salva progresso
            completedModules.add(moduleIndex);
            
            // Atualizar visual da tab
            const tabs = document.querySelectorAll('.tab');
            tabs[moduleIndex].classList.add('completed');
            
            // Atualizar progresso
            updateProgress();
            
            // Salvar progresso
            saveProgress();
            
            // Avan√ßar para pr√≥ximo m√≥dulo
            nextModule();
        }

        // Inicializa√ß√£o - carregar progresso salvo
        window.addEventListener('DOMContentLoaded', function() {
            createTabs();
            renderModules();
            
            // Carregar progresso salvo
            const savedProgress = loadProgress();
            
            if (savedProgress) {
                // Restaurar tabs completadas
                completedModules.forEach(modIndex => {
                    const tabs = document.querySelectorAll('.tab');
                    if (tabs[modIndex]) {
                        tabs[modIndex].classList.add('completed');
                    }
                });
                
                // Restaurar checklist e subm√≥dulos
                restoreCheckedItems(savedProgress.checkedItems);
                restoreExpandedSubmodules(savedProgress.expandedSubmodules);
                
                // Ir para o m√≥dulo salvo
                switchModule(currentModule);
            } else {
                // Primeira vez - come√ßar do zero
                switchModule(0);
            }
            
            updateProgress();
        });
    </script>
</body>
</html>
